import "./DescriptionBox.css";

function DescriptionBox(props) {
    let box = props.item.description_box
    return (
        <div className={props.item.description_box.position}>
        <h1 style={{display: box.style.title.display}}>Pancake</h1>
        <p style={{color: box.style.alergy_color}}>
            Млечно - Бело - Темно чоколадо, банана, јагода, пченично брашно, путер, млеко, квасец, сол, шеќер, јајца, ванилин, вода.
        </p>
        <h6>АЛЕРГЕН: Млеко, глутен, кикирики, јајца</h6>
        <h2>230den</h2>
        </div>
    );
}

export default DescriptionBox;
